import React from 'react';
import QRCode from 'qrcode.react';
import '../static/ticket.css';
import logo from '../logo.png';

export default function Ticket() {
  const ticketData = {
    id: 'CIN32',
    movieTitle: 'Avengers: Endgame',
    cinema: 'Cineplex Cinemas',
    date: '2023-06-10',
    time: '19:30',
    payment: 'Paid',
    seatNumber: 'A1'
  };

  return (
    <div className="ticket">
      <div className='ticket-header'>
      <img src={logo}/>
      <p><strong>Date:</strong> {ticketData.date}</p>
      </div>
      <div className="ticket-info">
        <div className="details">
	  <div className='distributions'>
          <span>Ticket ID:</span>
	  <p>{ticketData.id}</p>
	  </div>
          <p><strong>Movie:</strong> {ticketData.movieTitle}</p>
          <p><strong>Cinema:</strong> {ticketData.cinema}</p>
          <p><strong>Time:</strong> {ticketData.time}</p>
          <p><strong>Payment:</strong> {ticketData.payment}</p>
          <p><strong>Seat Number:</strong> {ticketData.seatNumber}</p>
        </div>
	<div className="qrcode">
          <QRCode value={JSON.stringify(ticketData)} size={128} />
        </div>
      </div>
    </div>
  );
}
